import React from 'react';
import ReactDOM from 'react-dom';
import ReactGA from 'react-ga';
import './index.css';
import Urban from './Urban';
import Network from './network';
import MainHeader from './Mainheader'
import { useLocation, Route } from 'react-router-dom';


// import * as ForceGraph2D from 'react-force-graph-2d';
// import * as d3 from 'd3';
// import * as d3Force from 'd3-force';

const App = props => {
  ReactGA.initialize('UA-128268752-1');
  ReactGA.pageview(window.location.search+window.location.pathname);

const location = useLocation()
console.log(location.pathname)
  
return (
<div>  
{location.pathname==='/network'? <MainHeader /> : null}
  <main>  
  {/* <Route path="/network">
    home
  </Route> */}
  <Route path="/networkmap">
    <Network />
  </Route>
  <Route path="/urban">
    <Urban />
  </Route>
  </main>
</div>
  );
};

export default App;
